import React from "react";

import {Switch, Route} from "react-router-dom";
import AdForm from "../AdForm";
import Ads from "../Ads";
import Vienas from "../SingleJobAd";
import SingleJobAd from "../SingleJobAd";
import login from "../login";

export default () => (

    <main className="container">
        <Switch>
            <Route exact path="/">
                <Ads/>
            </Route>
            <Route path="/createAd">
                <AdForm/>
            </Route>
            <Route path="/ad/:id">
                <SingleJobAd/>
            </Route>
            <Route path="/login">
                <login/>
            </Route>
        </Switch>
    </main>
)
